import React from "react";
import { View } from "react-native-web";
import {Bar} from 'react-chartjs-2';

const BarChart = () => {
    return <View>
        <Bar
            data={{
                labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange']
            }}
            height={400}
            width={600}
        />

    </View>
}

export default BarChart
